import React from 'react';
import '../styles/audio.css';
import '../styles/card.css';


function Audio() {
  return (
    <div className='audio'>
        <div className='audio-title'>Audio</div>
        <div className='audio-content'>
            <div className='audio-no'>2</div>
            <div className='audio-status'>PLAYING</div>
            <div className='audio-collection'>
            <div className='audio-total'>Total</div>
            <div className='audio-total-no'>5</div>
            </div>
           
        </div>
    </div>
  )
}

export default Audio
